INSERT INTO PUBLIC.STOCK_TEMPLATE(ID, TITLE, TITLE_FOR_ADMIN, DESCRIPTION, REPORT, STATUS, ADDED_BY, CTA) VALUES
(337, STRINGDECODE('\u0421 \u0443\u043b\u044b\u0431\u043a\u043e\u0439 \u0432 \u0448\u043a\u043e\u043b\u0443'), STRINGDECODE('\u0428\u043a\u043e\u043b\u04302017\u0444\u0430\u0441\u043e\u0432\u043a\u0430\u041a\u0440\u0433'), STRINGDECODE('\ud83c\udd98 \u0414\u043e\u0440\u043e\u0433\u0438\u0435 \u0432\u043e\u043b\u043e\u043d\u0442\u0435\u0440\u044b! \u041d\u0443\u0436\u043d\u0430 \u043f\u043e\u043c\u043e\u0449\u044c \u0441 \u0440\u0430\u0441\u0444\u0430\u0441\u043e\u0432\u043a\u043e\u0439 \u043a\u0430\u043d\u0446\u0435\u043b\u044f\u0440\u0441\u043a\u0438\u0445 \u0442\u043e\u0432\u0430\u0440\u043e\u0432 \u043f\u043e \u0448\u043a\u043e\u043b\u044c\u043d\u044b\u043c \u043d\u0430\u0431\u043e\u0440\u0430\u043c. \u0421\u0435\u0433\u043e\u0434\u043d\u044f \u043d\u0430\u0447\u043d\u0435\u043c \u0444\u0430\u0441\u043e\u0432\u043a\u0443 \u0432 17:30 \u043f\u043e \u0430\u0434\u0440\u0435\u0441\u0443: \u0443\u043b. \u0415\u0440\u043c\u0435\u043a\u043e\u0432\u0430 104/1. \n\u0412 \u043f\u0440\u0435\u0434\u0441\u0442\u043e\u044f\u0449\u0438\u0435 \u0432\u044b\u0445\u043e\u0434\u043d\u044b\u0435 \u043f\u043b\u0430\u043d\u0438\u0440\u0443\u0435\u043c \u0440\u0430\u0437\u0434\u0430\u0442\u044c \u044d\u0442\u0438 \u043d\u0430\u0431\u043e\u0440\u044b \u043f\u043e \u0434\u043e\u043c\u0430\u043c \u0441\u0435\u043c\u044c\u044f\u043c \u0438\u0437 \u041a\u0430\u0440\u0430\u0433\u0430\u043d\u0434\u044b.\n\ud83c\udd97 \u0415\u0441\u043b\u0438 \u0445\u043e\u0442\u0438\u0442\u0435 \u043f\u043e\u043c\u043e\u0447\u044c \u0441 \u0444\u0430\u0441\u043e\u0432\u043a\u043e\u0439 \u0434\u0430\u0439\u0442\u0435 \u043d\u0430\u043c \u0437\u043d\u0430\u0442\u044c \u043d\u0430\u0436\u0430\u0432 \u043d\u0430 \u043a\u043d\u043e\u043f\u043a\u0443 \"\u041f\u043e\u043c\u043e\u0433\u0443 \u0441 \u0444\u0430\u0441\u043e\u0432\u043a\u043e\u0439\"'), NULL, 0, 336243307, TRUE),
(338, STRINGDECODE('\u0421 \u0443\u043b\u044b\u0431\u043a\u043e\u0439 \u0432 \u0448\u043a\u043e\u043b\u0443'), STRINGDECODE('\u0428\u043a\u043e\u043b\u0430 2017 \u043a\u0440\u0433 13 \u0430\u0432\u0433\u0443\u0441\u0442\u0430'), STRINGDECODE('\ud83c\udf92 \u0414\u043e\u0440\u043e\u0433\u0438\u0435 \u0432\u043e\u043b\u043e\u043d\u0442\u0435\u0440\u044b, \u043d\u0430 \u044d\u0442\u0438 \u0432\u044b\u0445\u043e\u0434\u043d\u044b\u0435 \u0437\u0430\u043f\u043b\u0430\u043d\u0438\u0440\u043e\u0432\u0430\u043b\u0438 \u0430\u0434\u0440\u0435\u0441\u043d\u043e \u0440\u0430\u0437\u0434\u0430\u0442\u044c \u0448\u043a\u043e\u043b\u044c\u043d\u044b\u0435 \u043d\u0430\u0431\u043e\u0440\u044b \u0441\u0435\u043c\u044c\u044f\u043c \u0438\u0437 \u041a\u0430\u0440\u0430\u0433\u0430\u043d\u0434\u044b. \u0412\u0441\u0435\u0433\u043e 53 \u0441\u0435\u043c\u044c\u0438. \u0418\u0437 \u043a\u043e\u0442\u043e\u0440\u044b\u0445 8 \u0441\u0435\u0433\u043e\u0434\u043d\u044f \u043f\u043e\u043b\u0443\u0447\u0438\u043b\u0438 \u043d\u0430\u0431\u043e\u0440\u044b. \u041e\u0441\u0442\u0430\u043b\u043e\u0441\u044c 45 \u0441\u0435\u043c\u0435\u0439. \u0422\u0430\u043a \u0447\u0442\u043e \u043d\u0435 \u043e\u0441\u0442\u0430\u0432\u0430\u0439\u0442\u0435\u0441\u044c \u0432 \u0441\u0442\u043e\u0440\u043e\u043d\u0435\u203c\ufe0f\n\u0416\u0434\u0435\u043c \u0432\u0430\u0441 \u043f\u043e \u0430\u0434\u0440\u0435\u0441\u0443 \u0443\u043b. \u0415\u0440\u043c\u0435\u043a\u043e\u0432\u0430 104/1 (\u043d\u0430 \u0437\u0434\u0430\u043d\u0438\u0438  \u0432\u044b\u0432\u0435\u0441\u043a\u0430 \u0448\u0438\u043d\u043e\u043c\u043e\u043d\u0442\u0430\u0436 \"Formula7\"). \n\ud83d\ude4f \u0415\u0441\u043b\u0438 \u0445\u043e\u0442\u0438\u0442\u0435 \u043f\u043e\u0443\u0447\u0430\u0432\u0441\u0442\u0432\u043e\u0432\u0430\u0442\u044c \u0434\u0430\u0439\u0442\u0435 \u043d\u0430\u043c \u0437\u043d\u0430\u0442\u044c \u043d\u0430\u0436\u0430\u0432 \u043d\u0430 \u043a\u043d\u043e\u043f\u043a\u0443 \"\u043f\u043e\u043c\u043e\u04